(1, -1, 'inicio', 'Principal', 213, '1', '1', 1, '0', 1, 'frontpage', 'catalog_frontpage_headline_shop_BR', 'frontpage_teaser', ' ', '<i><b><font color="#0E668C" size="16">O que tem na loja?</font></b></i><br><br>Não importa o que você mais gosta de fazer no Habbo, você vai se divertir ainda mais visitando nossa Loja.<br><br><li>Entre para o <a href="event:catalog/open/habbo_club">Habbo Club</a></li><li><a href="event:catalog/open/set_pixelnew">Decore </a>seu Quarto</li><li>Adote um <a href="event:catalog/open/pet_horse">Mascote</a>, <a href="event:catalog/open/bots">Bot</a> ou <a href="event:catalog/open/monster_plants_info">Monsterplants</a></li><li>Crie seus próprios Jogos <a href="event:catalog/open/category_wired">Wired</a> </li><li>Faça negócios no <a href="event:catalog/open/marketplace_offers">Mercado</a></li><br><i><b><font color="#0E668C" size="16">Onde posso conseguir Créditos?</font></b></i><br><br>Aceitamos muitas formas de pagamento como SMS, Telefone, Cartões pré-pagos e Cartões de Crédito.<br><br><a href="event:habblet/open/credits">Visite nossa página de Créditos para mais informação.</a>', ' Gerar um código Habbo aqui:', '', ' ', '0', '', ''),
(2, -1, 'set_pixelnew', 'Mobis por Coleção', 197, '1', '0', 1, '0', 7, 'default_3x3', 'catalog_frontpage_headline2_en', '', ' ', '', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(3, -1, '', 'Duckets', 178, '1', '1', 1, '0', 11, 'info_duckets', 'catalog_frontpage_headline2_en', '', ' ', '<i><b><font color="#591d97" size="16">¿Qué son los Duckets?</font></b></i><br><br>Los Duckets son una divisa virtual gratuita que se puede conseguir a diario jugando en Linca.<br><br><i><b><font color="#591d97" size="16">¿Para qué sirven?</font></b></i><br><br>Los duckets están en Linca con el único propósito de premiar el tiempo que pases en el hotel.<br><br>Preparamos una categoría que contiene un set especial de Furnis, disponibles en <b>cantidades limitadas</b> y que se renueva periodicamente.<br><br><li><a href="event:catalog/open/fidelidad">¡Llevame allá!</a></li>', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(5, -1, 'habbo_club', 'Clube HC', 172, '1', '1', 1, '0', 2, 'vip_buy', 'catalog_header_hc', 'hc_catalog_teaser', ' ', 'Bobba club , aumente suas vantagens !', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
