(12, -1, 'pet_horse', 'Mascotes', 8, '1', '1', 1, '0', 16, 'pets2', 'catalog_pet_headline1', 'ctlg_pet_note', ' ', 'Mascotes são habitantes do Habbo Hotel e, assim como seus donos, precisam de alguns cuidados essenciais.', 'Algumas coisas que você deve saber:', '- Você pode colocar um Mascote no seu Quarto ou passear com ele em outros Quartos.\r\n- Você não pode negociar Mascotes, mas eles podem ir ao Quarto dos seus amigos para ganhar carinho\r\n- Você pode ter no máximo 50 mascotes no seu Quarto, mas cuide bem de todos!\r\n- Confira as necessidades dele, como água, comida e brinquedos. Veja a seção para Mascotes.\r\n- Ganhe Emblemas de Conquista treinando seu Mascote', ' <b>- Seu Mascote fica velho, mas não morre.\r\n- Você não pode negociar seu Mascote.</b>', '0', '', ''),
