(18, 2, '', 'Pinguins', 86, '1', '1', 1, '0', 49, 'default_3x3', 'catalog_arc_header1_en', '', ' ', 'Stay cool (or warm with out campfire!) with and create your own Winter Wonderland or Humble Homeland for your Penguins.', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
