(21, 2, '', 'Modes Rosas', 19, '1', '1', 1, '0', 42, 'default_3x3', 'catalog_candy_headline1', 'catalog_candy_teaser1', ' ', 'A bit more feminine than ''Mode'', this will add a bit of glamour and glitz to your rooms. Lacking a few items? Head on over to the ''Mode'' catagory!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
