(23, 2, '', 'Área', 14, '1', '1', 1, '0', 4, 'default_3x3', 'catalog_area_headline1', 'catalog_area_teaser1', ' ', 'A chunky and sofisticated line for the down-to-earth, studious Habbo. It''s simplicty is beautful and will add a welcoming charm to every room.', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
